//const list = notes.map((note) => <li>{note}</li>)
function App() {
  return (
    <container>
      <Jumbotron fluid>
        <Container>
          <h1>Fluid jumbotron</h1>
          <p>
            This is a modified jumbotron that occupies the entire horizontal space of its parent.
          </p>
        </Container>
      </Jumbotron>
      <Row>
        <Col sm={4} style={{backgroundColor: 'grey'}}>
          <ListGroup>
            {notes.map((note) => (
              <ListGroup.Item action variant="info">
                {note}
              </ListGroup.Item>
            ))}
          </ListGroup>
        </Col>
        <Col style={{backgroundColor: 'blue'}}>Editor</Col>
      </Row>
    </container>
  )
}

// getNote(3)

export default App
